import React , {useState} from 'react'
import './الملاعب.css' ;

import starPark from './starpark';


function الملاعب()  {
   
 
  const [san , setSan ]= useState(false) ;
  const [sentiage , setSentiage ]= useState(false) ;
  const [elshrouk , setElshrouk ]= useState(false) ;
      return(
        <div className="الملاعب">
         
         
          
        ,

         <button onClick={()=> { setStar(false) ; setSan(!san)  ; setSentiage(false); setElshrouk(false)   }  }>
           San Sero
         </button>

         <button onClick={()=>{ setStar(false) ; setSan(false)  ; setSentiage(!sentiage); setElshrouk(false)   }}>
           Sentiage
         </button>

         <button onClick={()=>{ setStar(false) ; setSan(false)  ; setSentiage(false); setElshrouk(!elshrouk)   }}>
           Elshrouk
         </button>

          <div className="table">
          
         
           {
            san? <h1>San</h1>   :null
          }
            
           {
            sentiage? <h1>Sentiage</h1> :null
          }
          
           {
            elshrouk? <h1>Elshrouk</h1> :null
          }
          
          </div>
          
          
         
         
          
          
        </div>
      
      )
    
  
}

export default الملاعب ;
